import './App.css';

function HelloWorld(props){
  return(
    <div id="hello">
      <h3>{props.subtitle}</h3>
      <p>{props.mytext}</p>
    </div>

  );
}

function App() {
  return (
    <div>This is my component: 
      <HelloWorld mytext="Option 1" subtitle="Name:"/>
      <HelloWorld mytext="Option 2"/> 
      <HelloWorld mytext="Option 3"/>
    </div>
  );
}

export default App;
